"Hér er tilvitnun í hluta textans; 

.....'' Soldiers of Allah - We will go forth as soldiers crushing our enemies with the Quaran of our lord as our resource - and it sends us in a new certainty that the day of a martyrship is a glorius victory - soldiers of Allah "......

Framangreindur texti er við myndir af friðsælum ísl sveitabæ og Þjóðgarði okkar að Þingvöllum. Hverjir eru ''enemies'' aðrir en kristnir Íslendingar?" Fékk þetta að láni ..
